        let r = randomInteger(255);
        let g = randomInteger(255);
        let b = randomInteger(255);
        return [r,g,b];
    }

    for(let i = 0; i < 5; i++) {
        console.log(randomColor());
    }


    console.log('in App');
    return(
        <>
            <div
                className="newColor"
                style={{
                    backgroundColor: randomColor
                }}
            ></div>
            <button onClick={e=>randomColor()}></button>
        </>
    )
}

export default App;
